import styled from 'styled-components';


export const Wrapper = styled.div`
    width: 100%;
    position: relative;
    display: flex;
    gap: 2rem;
    padding: 2rem;
    flex-direction: row;
    justify-content: flex-start;
    align-items: center;

    h1 {
        flex-grow: 2;
    }

    button {
        align-self: flex-end;
    }


`
